import React, { Component } from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import UserPageTabs from './components/tabs';
import Chip from '@material-ui/core/Chip';
import Typography from '@material-ui/core/Typography';
import Card from '@material-ui/core/Card';
import CardMedia from '@material-ui/core/CardMedia';

const styles = {
  card: {
    maxWidth: 345,
    marginTop:"20px",
    marginLeft: "auto",
    marginRight: "auto",
    marginBottom: "5px",
    width:"260px",
    height:"260px",
    borderRadius: "50%",
    backgroundColor:"lightgrey",
    display:"flex",
    justifyContent:"center",
    alignItems:"center"
  },
  media: {
    height: 0,
    paddingTop: '56.25%', // 16:9
  },
};


class UserPage extends Component {
  render() {
    console.log("userpage props", this.props);
    const { classes } = this.props;
    return (
      <div className="UserPage">
        <div className="LeftPane">
          <Card className={classes.card}>
            <CardMedia
              className={classes.media}
              image="/"
              title="Profile pic"
            />
          </Card>
          <div className="DescriptionDiv">
            <Typography variant="subheading" className="Description">short description</Typography>
          </div>
          <div className="InterestsDiv">
            <Typography variant="title">Interests</Typography>
            <div className="Chips">
              <Chip className="Chip" label="Blockchain"/>
              <Chip className="Chip" label="Cryptocurrency"/>
              <Chip className="Chip" label="Altcoins"/>
            </div>
          </div>
          <div className="SkillsDiv">
            <Typography variant="title">Skills</Typography>
            <div className="Chips">
              <Chip className="Chip" label="C++" />
              <Chip className="Chip" label="React" />
            </div>
          </div>
          <div className="BlockDiv">
            <a href="#/">Block or report user</a>
          </div>
        </div>
        <div className="RightPane">
          <UserPageTabs props={this.props}/>
        </div>
      </div>
    );
  }
}
UserPage.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(UserPage);
